BEGIN TRANSACTION;

CREATE TABLE estado (
    id integer PRIMARY KEY NOT NULL,
    nome text,
    uf character varying(2)
);

CREATE TABLE cidade (
    id integer PRIMARY KEY NOT NULL,
    nome text,
    codigo_ibge text,
    estado_id integer references estado(id)
);

CREATE TABLE pessoa (
    id integer PRIMARY KEY NOT NULL,
    nome text,
    nome_fantasia text,
    tipo character(1),
    codigo_nacional text,
    codigo_estadual text,
    codigo_municipal text,
    fone text,
    email text,
    observacao text,
    cep text,
    logradouro text,
    numero text,
    complemento text,
    bairro text,
    cidade_id integer references cidade(id),
    created_at timestamp,
    updated_at timestamp
);

CREATE TABLE lista_cnae (
    id integer PRIMARY KEY NOT NULL,
    codigo character varying,
    descricao character varying,
    versao character varying,
    ativo char(1)
);

CREATE TABLE lista_servico (
    id integer PRIMARY KEY NOT NULL,
    codigo text,
    descricao text
);

CREATE TABLE natureza_operacao (
    id integer PRIMARY KEY NOT NULL,
    codigo text,
    nome text,
    local_servico character(1),
    padrao character(1)
);

CREATE TABLE tipo_servico (
    id integer PRIMARY KEY NOT NULL,
    nome character varying(45),
    lista_cnae_id integer references lista_cnae(id),
    lista_servico_id integer references lista_servico(id)
);

CREATE TABLE tipo_servico_impostos (
    id integer PRIMARY KEY NOT NULL,
    tipo_servico_id integer references tipo_servico(id),
    imposto text,
    aliquota double precision,
    minimo double precision
);

CREATE TABLE servico (
    id integer PRIMARY KEY NOT NULL,
    nome text,
    valor double precision,
    tipo_servico_id integer NOT NULL references tipo_servico(id),
    ativo character(1)
);

CREATE TABLE nota_fiscal (
    id integer PRIMARY KEY NOT NULL,
    cliente_id integer NOT NULL references pessoa(id),
    dt_nota date,
    total double precision,
    transmitida character(1),
    cancelada character(1),
    natureza_operacao_id integer references natureza_operacao(id),
    local_servico character(1),
    chave text,
    emitida character(1)
);

CREATE TABLE nota_fiscal_item (
    id integer PRIMARY KEY NOT NULL,
    servico_id integer NOT NULL references servico(id),
    nota_fiscal_id integer NOT NULL references nota_fiscal(id),
    valor double precision,
    quantidade double precision,
    total double precision
);

CREATE TABLE regime_tributacao (
    id integer PRIMARY KEY NOT NULL,
    codigo text,
    nome text
);

CREATE TABLE venda (
    id integer PRIMARY KEY NOT NULL,
    cliente_id integer NOT NULL references pessoa(id),
    dt_venda date,
    total double precision,
    faturada character(1),
    cancelada character(1),
    nota_fiscal_id integer references nota_fiscal(id)
);

CREATE TABLE venda_item (
    id integer PRIMARY KEY NOT NULL,
    servico_id integer NOT NULL references servico(id),
    venda_id integer NOT NULL references venda(id),
    valor double precision,
    quantidade double precision,
    total double precision
);

CREATE TABLE cep (
    cep text,
    cod_cidade text
);
















COMMIT;
